function transformData(originalData) {
    // 创建一个新对象，不包含以“参数”开头的字段
    let transformedData = {};
    for (let key in originalData) {
        if (!key.startsWith("参数_")) {
            transformedData[key] = originalData[key];
        }
    }

    // 转换参数字段
    let parameters = [];
    for (let key in originalData) {
        if (key.startsWith("参数_")) {
            const parts = key.split(/[_＿]/)
            // node.warn(parts)
            const paramName = parts[2]; // 参数名称
            const paramType = parts[3]; // 参数类型，如“值”, “上限”, “下限”

            let param = parameters.find(p => p.name === paramName);
            if (!param) {
                param = { name: paramName, upper: '', lower: '', value: '', dataType: 0, result: 0 };
                parameters.push(param);
            }

            switch(paramType) {
                case '上限':
                    param.upper = originalData[key].toString();
                    break;
                case '下限':
                    param.lower = originalData[key].toString();
                    break;
                case '值':
                    param.value = originalData[key].toString();
                    break;
                default:
                    break; // 其他类型不处理
            }
        }
    }

    // 添加转换后的参数字段
    transformedData.parameters = parameters;

    return transformedData;
}

